import { ADD_EXPENSE_TYPE, DELETE_EXPENSE_TYPE } from '../actions';

const INITIAL_STATE = {
  wallet: {
    currencies: [],
    expenses: [],
    totalExpense: 0,
  },
};

function walletReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
  case ADD_EXPENSE_TYPE:
    const { expenses } = this.state;
    console.log(state);
    return {

      ...state,
      expenses: [...state.expenses, action.value] };

    // case DELETE_EXPENSE_TYPE:
    //   console.log('delete');

  default:
    return state;
  }
}

export default walletReducer;
